import React from 'react';
import ParticipantItem from './ParticipantItem';

const Participants = ({participants, loading}) => {

  let participantList = '';

  if(loading) {

    participantList = (
      <li className='collection-item center collection-item-block'>
        Loading...
      </li>
    )
  }
  else {
    participantList = (
      participants.map(participant => {
        return <ParticipantItem participant={participant} key={participant._id}/>
      })
    );
  }


  return (
    <div>
      <h3>Participants</h3>
      <ul>
        {participantList}
      </ul>
    </div>
  )
}

export default Participants;
